import React from 'react';

import { makeStyles, useTheme } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';

import Nav from '../../components/Navigation/Nav';
import Jumbotron from '../../components/Home/Jumobtron';

function Home() {

    return (
        <Grid container >
            <Grid xs={12}>
                <Nav />
            </Grid>
            <Grid xs={12}>
                <Jumbotron />
            </Grid>
            <Grid xs={12}>
                //main
            </Grid>
        </Grid>
    );
}

export default Home;
